const express = require("express");
const app = express();
const mongoose = require("mongoose");
app.use(express.json());
export const getAllNavigate = () => {
  mongoose("mongodb://localhost:3000/navigate")
    .then((res) => res.json())
    .then((body) => body?.data);
};

export const getAllProducts = () => {
  return fetch("/trasport-products")
    .then((res) => res.json())
    .then((body) => body.products);
};
